  return (
    <div>
      
      <div className="container">
      <h4>Jobs</h4>
        <div className="row align-items-start">
          <div className="col-3">Imagen del job</div>
          <div className="col-9">Descripcion del job</div>
        </div>
        <div className="row align-items-start">
          <div className="col-3">Imagen del job</div>
          <div className="col-9">Descripcion del job</div>
        </div>
        <div className="row align-items-start">
          <div className="col-3">Imagen del job</div>
          <div className="col-9">Descripcion del job</div>
        </div>
      </div>
    </div>
  );
}
export default empleos;
